import logo from './logo.svg';
import './App.css';
import { Route, Switch, Redirect, useLocation } from "react-router-dom";
import Homepage from "./pages/Homepage/Homepage";


const App = () => {

  return (
    <div className="App">
      <Switch>
        <Route
          exact
          path="/"
          render={() => <Homepage />}
        >
        </Route>
      </Switch>
    </div>
  )
} 

export default App;
